import styles from './HomePage.module.css'

function HomePage() {
  return (
    <div className="HomePage">
      <img className={styles.landingImg} src='/images/versaillesGarden.jpg' alt='Girl sitting in Versailles Garden'/>
      <p>Hello!</p>
    </div>
    );
  }
  
  export default HomePage;
